function App() {
  const handleInput = (ev) => {
    console.log(`La última techa pulsada fue:${handleInput.keyCode}`);
  };
  return (
    <form>
      <input type="text" onKeyUp={handleInput}></input>
    </form>
  );
}

export default App;
